import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import { Login } from "./Auth";
import { Workspace } from "./Workspace";
import { Signup }  from  "./Signup";




import PersonalPageLayout from "./Personal/Layout/PageLayout";
import ManagementPageLayout from "./Management/Layout/PageLayout";

class App extends React.Component {
 constructor(props) {
    super(props);
   this.state = {
     value_pie :'',
     count:0,
     name:' test react'
   };
   this.test = this.handleSubmit.bind(this);
 }
 render() {
  const panel = localStorage.panel;
  console.log("panel", panel);
  const t ='test'
  return (
    <Router>
      <Route path="/" exact component={Login} />
      <Route path="/workspace" exact component={Workspace} />
      <Route path="/signup-page" exact component={Signup} />
      {panel === "personal" && <PersonalPageLayout  data={t}/>}
      {panel === "management" && <ManagementPageLayout />}
    </Router>
  );
}
}
export default App;
